import Box from "@mui/material/Box";
import { TreeViewBaseItem } from "@mui/x-tree-view/models";
import { RichTreeView } from "@mui/x-tree-view/RichTreeView";
import PHONEME_SCHEMA from "./phonemeSchema";

const treeTag = () => {
  return <div onClick={(e) => {}}>yea</div>;
};

let usedIDs = [];
const generateID = (ID) => {
  if (usedIDs.includes(ID)) {
    ID = ID + "i";
  }
  usedIDs.push(ID);
  return ID;
};
const generatePhonemeItems = (PHS) => {
  if (typeof PHS === "object") {
    return {
      id: PHS.id,
      label: PHS.id,
      children: PHS.c.map((cc) => {
        //console.log(cc);
        return generatePhonemeItems(cc);
      }),
    };
  } else {
    return { id: PHS, label: PHS };
  }
};

function PhonemeDropDown() {
  const sy = generatePhonemeItems(PHONEME_SCHEMA);
  console.log(sy);
  return (
    <Box
      sx={{
        minHeight: 33,
        flexGrow: 1,
        backgroundColor: "white",
        boxShadow: "5px 5px 10px gray",
        borderRadius: "5px",
        overflowY: "scroll",
        overflow: "auto",
        maxHeight: "65%",
      }}
      className="phone-drop"
    >
      <RichTreeView items={[sy]} />
    </Box>
  );
}

export default PhonemeDropDown;
